import React from "react";
import { Button } from "react-bootstrap"; 

const Details = ({ data }) => {
  const Link = data[0][1];
  const tempArea = data[0][2];
  const tempPerimeter = data[0][3];
  const area = tempArea[0].toFixed(4);
  const perimeter = tempPerimeter[0].toFixed(4);


  return (
    <div className="container-menu">
    <div className="bbox">
      <h4>API</h4>
      <a href={Link}>{Link}</a>
      <br/><br/>
      <h3>Details</h3>
      <br/>
      <h4>Area: {area} hectare</h4>
      <br/>
      <h4>Perimeter: {perimeter} Km</h4>
      <Button >
          Download
          </Button>
      </div>
    </div>
  );
};

export default Details;
